import { useState } from "react"
import { Link, useNavigate } from "react-router-dom";
import toast from "react-hot-toast";
import { AiOutlineEye, AiOutlineEyeInvisible} from "react-icons/ai"

function LoginForm({setIsLoggedIn}){
const navigate = useNavigate();

    const[showPassword,setShowPassword] = useState(false);
    const[formData,setFormData] = useState({
        email:"",password:""
    })
    function changeHandler(event){
        setFormData((prevData) =>({
            ...prevData,
            [event.target.name]:event.target.value
        }))
    }
    function passwordHandler(){
        setShowPassword(!showPassword);
    }
    function submitHandler(event){
          event.preventDefault();
          setIsLoggedIn(true);
          toast.success("Logged In");
          navigate("/dashboard");
    }
    return(
        <form onSubmit={submitHandler} className="flex flex-col w-full gap-y-4 mt-6">
           <label className="w-full">
            <p className="text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]">Email Address<sup>*</sup></p>
            <input className="bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[8px]" required
            type="email" value={formData.email}
            onChange={changeHandler} placeholder="Enter email id" name="email"></input>
           </label>

           <label className="w-full relative">
            <p className="text-[0.875rem] text-richblack-5 mb-1 leading-[1.375rem]">Password<sup>*</sup></p>
            <input className="bg-richblack-800 rounded-[0.5rem] text-richblack-5 w-full p-[8px]" required
            type={showPassword ? ("text") : ("password")} value={formData.password}
            onChange={changeHandler} placeholder="Password" name="password"></input>

            <span onClick={passwordHandler} className="absolute right-3 top-[38px] cursor-pointer">
                {!showPassword ? (<AiOutlineEye fontSize={24} fill='#AFB2BF'/>):(<AiOutlineEyeInvisible fontSize={24} fill='#AFB2BF'/>)}
            </span>
            <Link to="#">
              <p className="max-w-max ml-auto text-xs mt-1 text-blue-100">Forgot Password?</p>
            </Link>
           </label>

           <button>
            Sign In
           </button>
        </form>
    )
}

export default LoginForm
